Excited to share that one of my polaroids will be included in the upcoming show “New Images of Women” @shootthelobster opening this Saturday in New York City. 

Such an amazing feeling to share the walls with these incredible photographers and artists I’ve always looked up to. Hope to see some of you there!

@cindysherman @richardkernstudio @sophialamarnyc @mr.shuffles @_brittanyadeline @leandercapuozzo1 @matias__anon @hilton.als @curtiscmitchell @belloore @yazzzkat @vlntnavaccarella @alexbag666 @duncanhannah

i don’t normally post my commercial work on here but revisiting an old shoot for @tejesta and forgot how great these came out. shot on 35mm and 120mm in Joshua Tree in 2021 🧡

